#include "header.h"

void printDate(Waktu date[], int n) {

    for (int i = 0; i < n; ++i) {
        if (date[i].N != "" || date[i].Y != 0 || date[i].M != 0 || date[i].D != 0 ) {
            cout << date[i].N << " - " << date[i].Y << "-"
             << date[i].M << "-" << date[i].D << endl;
        }
    }
}

void menu(Waktu dummies[10000]) {
    Waktu data[10000]; // Assuming Data is defined elsewhere
    int opt, n;
    string lnjt = "Y";
    while (lnjt != "N") {
        cout << "How Many Data will you want to Sort? ";
        cin >> n;
        for (int i = 0; i < n; ++i) {
            data[i] = dummies[i];
        }
        int length = *(&data + 1) - data;

        cout << "================================" << endl;
        cout << "1. Rekursif" << endl;
        cout << "2. Iteratif" << endl;
        cout << "================================" << endl;
        cout << "Choose: ";
        cin >> opt;
        if (opt == 1) {
            for (int i = 0 ; i< 3;i++){
                cout<<"Processing"<<endl;
                auto start = chrono::steady_clock::now();
                selectionRecursive(data, 0, n);
                auto end = chrono::steady_clock::now();
                double elapsed_s = chrono::duration_cast<chrono::nanoseconds>(end - start).count() / 1e9;
                cout << "Waktu eksekusi untuk " << n << " elemen: " << elapsed_s << " detik" << endl;
            };
        } else if (opt == 2) {
            for (int i = 0 ; i< 3;i++){
                cout<<"Processing"<<endl;
                auto start = chrono::steady_clock::now();
                selectionIterative(data ,n);
                auto end = chrono::steady_clock::now();
                double elapsed_s = chrono::duration_cast<chrono::nanoseconds>(end - start).count() / 1e9;
                cout << "Waktu eksekusi untuk " << n << " elemen: " << elapsed_s << " detik" << endl;
            };
        }

        cout  << "Lanjut ?(Y/N)";
        cin >> lnjt;
    }
    int length = *(&data + 1) - data;
    printDate(data, length);
    delete[] data;
    delete[] dummies;
}

